import React from 'react';

const eventTypes = [
    "Company Retreats", "Training Programs", "Family Reunions", "Group Getaways",
    "Educational Camps or Workshops", "Corporate Off-sites", "Executive Meetings",
    "Destination Weddings", "Wellness Retreats", "Special Events or Celebrations"
];

const EventType = () => {
    return (
        <div className="py-5 lg:w-3/4 w-full flex gap-5 flex-wrap px-5 border-t mx-auto">
            <h2 className="text-3xl font-bold mb-4 lg:w-1/5 w-full">Event type</h2>
            <div className="flex flex-wrap gap-4">
                {eventTypes.map((type, index) => (
                    <span key={index} className="px-4 py-2 border rounded-full t bg-lightGray cursor-pointer hover:bg-gray-200">
                        {type}
                    </span>
                ))}
            </div>
        </div>
    );
};

export default EventType;
